import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Layout from './components/layout/Layout';

// Personal Pages
import Goals from './pages/Personal/Goals';
import InternshipJourney from './pages/Personal/InternshipJourney';
import Logbook from './pages/Personal/Logbook';
import University from './pages/Personal/University';

// Labs Pages
import AI from './pages/Labs/AI';
import Automation from './pages/Labs/Automation';
import Brainstorming from './pages/Labs/Brainstorming';
import DataViz from './pages/Labs/DataViz';
import Projects from './pages/Labs/Projects';

// Research Pages
import Classification from './pages/Research/Classification';
import Clustering from './pages/Research/Clustering';
import DeepLearning from './pages/Research/DeepLearning';
import NeuralNetworks from './pages/Research/NeuralNetworks';
import Regression from './pages/Research/Regression';

// Contract Pages
import Contact from './pages/Contract/Contact';
import Details from './pages/Contract/Details';
import Email from './pages/Contract/Email';
import GitHub from './pages/Contract/GitHub';
import Resume from './pages/Contract/Resume';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          {/* Personal Routes */}
          <Route path="/personal/internship" element={<InternshipJourney />} />
          <Route path="/personal/goals" element={<Goals />} />
          <Route path="/personal/university" element={<University />} />
          <Route path="/personal/logbook" element={<Logbook />} />

          {/* Labs Routes */}
          <Route path="/labs/ai" element={<AI />} />
          <Route path="/labs/automation" element={<Automation />} />
          <Route path="/labs/dataviz" element={<DataViz />} />
          <Route path="/labs/brainstorming" element={<Brainstorming />} />
          <Route path="/labs/projects" element={<Projects />} />

          {/* Research Routes */}
          <Route path="/research/neural-networks" element={<NeuralNetworks />} />
          <Route path="/research/classification" element={<Classification />} />
          <Route path="/research/regression" element={<Regression />} />
          <Route path="/research/clustering" element={<Clustering />} />
          <Route path="/research/deep-learning" element={<DeepLearning />} />

          {/* Contract Routes */}
          <Route path="/contract/details" element={<Details />} />
          <Route path="/contract/github" element={<GitHub />} />
          <Route path="/contract/email" element={<Email />} />
          <Route path="/contract/resume" element={<Resume />} />
          <Route path="/contract/contact" element={<Contact />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
